import React, { useContext } from "react";
import ExerciseCard from "./Exercisecard";
import { ExerciseContext } from "./App";

function CurrentWorkoutDisplay() {
    const { currExercises, addNewSet } = useContext(ExerciseContext);

    return (
        <div>
            {Object.keys(currExercises).map((key) => (
                <ExerciseCard
                    key={key}
                    exerciseName={key}
                    addNewSet={addNewSet}
                    sets={currExercises[key]}
                />
            ))}
        </div>
    );
}

export default CurrentWorkoutDisplay;
